def calculate_minimum_completion_time(n, m, a):

    def moze(v, r, n):
        s = 0
        for i in range(n):
            if r[i] - v < 0:
                s += (-r[i] + v) // 2
            else:
                s -= r[i] - v
        return s >= 0

    def nadji(r, n, m):
        l = (m - 1) // n + 1
        right = 2 * l
        iz = -1
        while l <= right:
            sredina = (l + right) // 2
            if moze(sredina, r, n):
                right = sredina - 1
                iz = sredina
                continue
            else:
                l = sredina + 1
        return iz
    r = [0] / n
    for i in range(m):
        r[a[i] - 1] += 1
    return nadji(r, n, m)

